                DT: '',
            }
        }

    } catch (error) {
        return {
            EM: 'Database error',
            EC: '1',
            DT: '',
        }
    }
}
const deletePackage = async (id) => {
    try {
        let data = await db.Packages.findOne({
            where: { id: id }
        })
        if (data) {
            let res = await db.Packages.destroy({
                where: { id: id }
            });
            console.log(res);
            return {
